import logo from "./image1.png";
import "./App.css";
function App() {
  return (
    <div className="centeredBlock">
      <h1>Rohan Tyagi</h1>
      <img src={logo} className="centeredImage"></img>
      <br></br>
      <p>
        Throughout my years at <b>Enloe High School</b> I have gained experience{" "}
        in many subjects. At the moment, I aim to double-major in{" "}
        <b>Mechanical Engineering</b> and <b>Computer Science</b>. I enjoy
        creating and building working projects as well as programming tasks to
        automate them.
      </p>
    </div>
  );
}

export default App;
